<div id='map'></div>

<script>
	var map = L.map('map').setView([15.978876, 80.789531], 12);

	L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
		attribution: '@ A GarudaDev analysis'
	}).addTo(map);

	blue= L.icon({
    iconUrl: 'blue.png',
    iconSize:     [12, 12], 
    iconAnchor:   [10, 10],
	});
	red=L.icon({
    iconUrl: 'red.png',
    iconSize:     [12, 12], 
    iconAnchor:   [-10, -10],
	});
	yellow=L.icon({
    iconUrl: 'yellow.png',
    iconSize:     [12, 12], 
    iconAnchor:   [0, 0],
	});

	function getIcon(party) {
		if (party=="YSRCP") return blue;
		if (party=="JNP") return red;
		return yellow;
	}
	for (var i in data)
		{
		L.marker(
			[data[i][0],data[i][1]], 
			{icon: getIcon(data[i][3])}).bindPopup(matter[data[i][0]+"-"+data[i][1]]["matter"]).addTo(map);}
</script>
